function AccountScreen(props) {
    return (
        <Screen>
            <ListItem 
            title='Richard Hendricks'
            subTitle='richard@pau.edu.ng'
            imagee={require('../assets/richard.jpg')}
            />
        </Screen>
    );
}

export default AccountScreen;
